using System;
using System.Collections.Concurrent;
using System.Collections.Generic;
using System.Diagnostics;
using System.Reactive.Concurrency;
using System.Reactive.Linq;
using System.Text;
using System.Threading;
using System.Threading.Tasks;
using RxMqtt.Shared.Messages;

namespace RxMqtt.Client.Console
{
    class Program
    {
        private static MqttClient _mqttClient;

        private static Dictionary<string, IDisposable> _subscriptions = new Dictionary<string, IDisposable>();

        private static ManualResetEventSlim _mre = new ManualResetEventSlim();

        static async Task Main(string[] args)
        {
            System.Console.CancelKeyPress += Console_CancelKeyPress;

            var defaultClientId = $"client-{DateTime.Now.Hour}.{DateTime.Now.Minute}.{DateTime.Now.Millisecond}";
            var defaultIp = "127.0.0.1";

            foreach (var arg in args)
            {
                if (arg.Contains("clientid"))
                {
                    defaultClientId = arg.Split('=')[1];
                }
                if (arg.Contains("broker"))
                {
                    defaultIp = arg.Split('=')[1];
                }
            }

            System.Console.WriteLine($"ClientId ({defaultClientId}): ");

            var clientId = System.Console.ReadLine();

            if (string.IsNullOrEmpty(clientId))
                clientId = defaultClientId;

            System.Console.WriteLine($"Ip address ({defaultIp}): ");

            var ip = System.Console.ReadLine();

            if (string.IsNullOrEmpty(ip))
                ip = "127.0.0.1";

            _mqttClient = new MqttClient(clientId.Trim(), ip.Trim(), 1883, 5); // "172.16.0.244"

            var s = await _mqttClient.InitializeAsync();

            System.Console.WriteLine($"MQTT => {s}");

            if (s != Shared.Enums.Status.Initialized)
            {
                System.Console.WriteLine("Error connecting...");
                return;
            }

            while (true)
            {
                System.Console.WriteLine("s => subscribe");
                System.Console.WriteLine("u => unsubscribe");
                System.Console.WriteLine("p => publish");
                System.Console.WriteLine("q => quit");

                var line = System.Console.ReadLine();

                if (string.IsNullOrEmpty(line))
                    continue;

                if (line.StartsWith("q"))
                {
                    _mqttClient?.Dispose();
                    return;
                }

                if (line.StartsWith("s"))
                {
                    System.Console.WriteLine("Topic:");
                    var subscribeTopic = System.Console.ReadLine();

                    if (string.IsNullOrEmpty(subscribeTopic) || _subscriptions.ContainsKey(subscribeTopic))
                    {
                        System.Console.WriteLine("Empty topic or already subscribed");
                        continue;
                    }

                    //await _mqttClient.Subscribe(Callback, subscribeTopic);

                    var observable = await _mqttClient.WhenPublishedOn(subscribeTopic);
                    _subscriptions.Add(subscribeTopic, observable.ObserveOn(Scheduler.Default).Subscribe(Callback));
                    //observable.ObserveOn(Scheduler.Default).Subscribe(Callback);//Hm

                    System.Console.WriteLine("subscribed");
                }

                if (line.StartsWith("u"))
                {
                    System.Console.WriteLine("Topic:");
                    var unsubscribeTopic = System.Console.ReadLine();

                    if (string.IsNullOrEmpty(unsubscribeTopic) || !_subscriptions.ContainsKey(unsubscribeTopic))
                        continue;

                    await _mqttClient.Unsubscribe(unsubscribeTopic);

                    var subscription = _subscriptions[unsubscribeTopic];
                    subscription?.Dispose();

                    _subscriptions.Remove(unsubscribeTopic);

                    System.Console.WriteLine("unsubscribed");
                }

                if (!line.StartsWith("p"))
                    continue;

                System.Console.WriteLine("Publish to topic:");
                var topic = System.Console.ReadLine();

                if (string.IsNullOrEmpty(topic))
                {
                    System.Console.WriteLine("Need a topic...");
                    continue;
                }

                System.Console.WriteLine("Message to publish:");
                var msg = System.Console.ReadLine();

                //msg = "";

                if (string.IsNullOrEmpty(msg))
                {
                    System.Console.WriteLine("Nothing to publish...");
                    continue;
                }

                System.Console.WriteLine("Publish count (1):");
                var count = System.Console.ReadLine();

                if (string.IsNullOrEmpty(count))
                    count = "1";

                System.Console.WriteLine("Publish interval (50ms):");
                var delay = System.Console.ReadLine();

                if (string.IsNullOrEmpty(delay))
                    delay = "50";

                System.Console.WriteLine("Press ctrl+c to cancel publish operation...");

                await Publish(msg, topic, count, delay);
            }
        }

        private static void Console_CancelKeyPress(object sender, ConsoleCancelEventArgs args)
        {
            args.Cancel = true; //Prevents ctrl+c from exiting console
            System.Console.WriteLine("Canceling...");
            _mre.Set();
        }

        private static void Callback(Publish publishedMessage)
        {
            System.Console.WriteLine($"To topic: '{publishedMessage.Topic}' => '{Encoding.UTF8.GetString(publishedMessage.Message)}'");
        }

        /// <summary>
        /// Throws timeout exception after 2 seconds
        /// </summary>
        /// <param name="msg"></param>
        /// <param name="topic"></param>
        /// <param name="count"></param>
        /// <returns></returns>
        private static async Task Publish(string msg, string topic, string count, string delay)
        {
            var sw = new Stopwatch();
            sw.Start();

            int parsedCount;

            if (!int.TryParse(count, out parsedCount))
            {
                parsedCount = 1;
            }

            int parsedDelay;

            if (!int.TryParse(delay, out parsedDelay))
            {
                parsedDelay = 50;
            }

            for (var i = 0; i < parsedCount; i++)
            {
                try
                {
                    var r = await _mqttClient.PublishAsync(msg, topic);

                    if (_mre.IsSet)
                    {
                        sw.Stop();

                        System.Console.WriteLine($"Publish canceled after publishing {i} in {sw.Elapsed}");
                        _mre.Reset();
                        return;
                    }

                    if (parsedDelay > 0)
                    {
                        await Task.Delay(parsedDelay);
                    }
                }
                catch (Exception e)
                {
                    System.Console.WriteLine(e.Message);
                    return;
                }
            };

            sw.Stop();

            System.Console.WriteLine($"Publish completed {count} in {sw.Elapsed}");
        }
    }
}
